USE master
IF EXISTS(SELECT * FROM master.sys.databases WHERE name='PerkBankDb')
BEGIN
    DROP DATABASE PerkBankDb
	CREATE DATABASE PerkBankDb
	COLLATE TURKISH_CI_AI;
	PRINT '--------------- DATABASE OLUŞTURULDU --------------'
END
ELSE
BEGIN
	CREATE DATABASE PerkBankDb
	COLLATE TURKISH_CI_AI;
	PRINT '--------------- DATABASE OLUŞTURULDU --------------'
END

GO
