PRINT ''
GO
PRINT '----------- ŞEMALAR OLUŞTURULUYOR ------------'
GO
CREATE SCHEMA Enterprise
GO
PRINT '            Enterprise'
GO
CREATE SCHEMA Account
GO
PRINT '            Account'
GO
PRINT '--------------- TABLOLAR OLUŞTURULUYOR --------------'
GO
CREATE TABLE Enterprise.LookupTypes
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	Name VARCHAR(30) NOT NULL,
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 
)
PRINT '            Enterprise.LookupTypes'
CREATE TABLE Enterprise.Lookups
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	Name VARCHAR(50) NOT NULL,
	UpLookupId INT NULL,
	LookupTypeId INT NOT NULL,
	RowOrder INT NULL,
	ShortCode VARCHAR(10) NULL,
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 

	CONSTRAINT FK_LookUp_LookUpType FOREIGN KEY (LookupTypeId) REFERENCES Enterprise.LookupTypes(Id),
	CONSTRAINT FK_LookUp_UpLookUp FOREIGN KEY (UpLookupId) REFERENCES Enterprise.Lookups(Id)
)
PRINT '            Enterprise.Lookups'

CREATE TABLE Enterprise.ActorTypes
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	Name VARCHAR(20) NOT NULL,
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 
)
PRINT '            Enterprise.ActorTypes'

CREATE TABLE Enterprise.Actors
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	Name VARCHAR(40) NOT NULL,
	UpActorId INT NULL,
	ActorTypeId INT NOT NULL,
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 

	CONSTRAINT FK_Actor_ActorType FOREIGN KEY (ActorTypeId) REFERENCES Enterprise.ActorTypes(Id)
)
PRINT '            Enterprise.Actors'

CREATE TABLE Enterprise.Users
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	Username VARCHAR(20) NOT NULL,
	Password VARCHAR(64) NOT NULL,
	LastLoginDate DATETIME NULL,
	ActorId INT NULL,
	
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 

	CONSTRAINT FK_User_Actor FOREIGN KEY (ActorId) REFERENCES Enterprise.Actors(Id)
)
PRINT '            Enterprise.Users'

CREATE TABLE Account.Accounts
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	AccountNumber CHAR(14) NOT NULL,
	ActorId INT NOT NULL,
	CurrencyTypeId INT NOT NULL,
	AccountTypeId INT NOT NULL,
	Amount MONEY NULL DEFAULT 0,
	
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 

	CONSTRAINT FK_Account_Actor FOREIGN KEY (ActorId) REFERENCES Enterprise.Actors(Id),
	CONSTRAINT FK_Account_LookupsCurrency FOREIGN KEY (CurrencyTypeId) REFERENCES Enterprise.Lookups(Id),
	CONSTRAINT FK_Account_LookupsType FOREIGN KEY (AccountTypeId) REFERENCES Enterprise.Lookups(Id),
)
PRINT '            Account.Accounts'

CREATE TABLE Enterprise.Metadatas
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	Name VARCHAR(30) NOT NULL,
	DataType TINYINT NOT NULL,
	DataTypeName VARCHAR(30),
	
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 
)
PRINT '            Enterprise.Metadatas'

CREATE TABLE Enterprise.ActorDatas
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	ActorId INT NOT NULL,
	MetadataId INT NOT NULL,
	Value VARCHAR(100) NOT NULL,
	
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 

	CONSTRAINT FK_ActorData_Actor FOREIGN KEY (ActorId) REFERENCES Enterprise.Actors(Id),
	CONSTRAINT FK_ActorData_Metadata FOREIGN KEY (MetadataId) REFERENCES Enterprise.Metadatas(Id),
)
PRINT '            Enterprise.ActorDatas'

CREATE TABLE Account.TransferHistory
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	FromId INT NOT NULL,
	ToId INT NOT NULL,
	Amount MONEY NOT NULL,
	
	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 

	CONSTRAINT FK_History_FromAccount FOREIGN KEY (FromId) REFERENCES Account.Accounts(Id),
	CONSTRAINT FK_History_ToAccount FOREIGN KEY (ToId) REFERENCES Account.Accounts(Id),

	CHECK (Amount >= 1)
)
PRINT '            Account.TransferHistory'

CREATE TABLE Account.History
(
	Id INT PRIMARY KEY IDENTITY (1,1),
	AccountId INT NOT NULL,
	Amount MONEY NOT NULL,
	TypeId INT NOT NULL,
	Description VARCHAR(50) NULL,

	IsActive BIT DEFAULT 1,
	Created DATETIME DEFAULT GETDATE(), 
	Modified DATETIME DEFAULT GETDATE(), 

	CONSTRAINT FK_History_Account FOREIGN KEY (AccountId) REFERENCES Account.Accounts(Id),
)
PRINT '            Account.History'

